import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { NavigationService } from '../../services/navigation.service';

@Component({
  selector: 'app-page4',
  templateUrl: './page4.component.html',
  styleUrls: ['./page4.component.css']
})
export class Page4Component {

  constructor(private router: Router, private navigationService: NavigationService) { }

  navigateToPage(page: string, buttonName: string): void {
    this.navigationService.recordButtonClick(buttonName).subscribe(() => {
      this.router.navigate([`/${page}`]);
    });
  }

  logout(): void {
    console.log('User logged out');
    sessionStorage.removeItem('userId');
    this.router.navigate(['/login']);
  }

  goToUpdates(): void {
    this.router.navigate(['/navigation']);
  }
}
<header>
  <div class="cards">
    <div class="card red" [routerLink]="['/page1']">
      <p class="tip">Sayfa 1 e git</p>
    </div>
    <div class="card blue" [routerLink]="['/page2']">
      <p class="tip">Sayfa 2 e git</p>
    </div>
    <div class="card blue" [routerLink]="['/page3']">
      <p class="tip">Sayfa 3 e git</p>
    </div>
    <div class="card green" (click)="logout()">
      <p class="tip">Çıkış Yap</p>
    </div>
  </div>
</header>

<main>
  <button class="button" (click)="recordButtonClick('customButton')">
    <!-- Button içeriği -->
  </button>
</main>
